import React from "react";
import Navbar from "./Navbar";
import "../pagecss/Home.css";
import homeph from "../photos/photoph.png";
import Produits from "./Produits";
import photo from "../photos/photosp.jpeg";
import Produit from "./Data";

function Home() {
  return (
    <div>
      <Navbar />

      <img src={homeph} alt="" className="home_photo" />
      <p className="home_categ" style={{ fontSize: "1.5em" }}>
        {" "}
        Sport{" "}
      </p>


      <select name="" id="mySelect" className='sign-up_nav--select'>
            <option value="" className='sign-up_nav--option'>Catégories</option>
           <option value="" className='sign-up_nav--option'> <a href='#tecno'>Technologie </a> </option>
            <option value="" className='sign-up_nav--option'>Cuisine</option>
            <option value="" className='sign-up_nav--option'>décoration</option>
          </select>











      <div className="produits">

        {Produit.map((produit, index) => (
          <div key={index}>
            <Produits info={produit} />
          </div>
        ))}
      </div>


    </div>
  );
}

export default Home;
